import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';  // BrowserRouter for routing
import App from './App';  // Import App component
import './index.css';  // Import global styles

ReactDOM.render(
  <React.StrictMode>
    <Router>  {/* Wrap the application with BrowserRouter */}
      <App />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')  // Render the app into the root element
);
